177.body:
Alan has been adding an extension to YouBuy that launches a singleton actor which interacts with a Sqlite database using the sqlx crate. The Sqlite database only permits a single active connection at a time, but this is not a problem, because the actor is a singleton, and so there only should be one at a time. He consults the documentation for sqlx and comes up with the following code to create a connection and do the query he needs: use sqlx::Connection; #[async_std::main]
async fn main() -> Result<(), sqlx::Error> { // Create a connection let conn = SqliteConnection::connect("sqlite::memory:").await?; // Make a simple query to return the given parameter let row: (i64,) = sqlx::query_as("SELECT $1") .bind(150_i64) .fetch_one(&conn).await?; assert_eq!(row.0, 150); Ok(())
} Things seem to be working fairly well but sometimes when he refreshes the page he encounters a panic with the message "Cannot open a new connection: connection is already open". He is flummoxed.

178.body:
Alan tries to figure out what happened from the logs, but the only information he sees is that a new connection has been received. Alan turns to the documentation for the sqlx crate to see if there are flags that might enable extra instrumentation but he can't find any. He's a bit confused, because he's accustomed to having things generally be cleaned up automatically when they get dropped (for example, dropping a File will close it). Searching the docs, he sees the close method, but the comments confirm that he shouldn't have to call it explicitly: "This method is not required for safe and consistent operation. However, it is recommended to call it instead of letting a connection drop as the database backend will be faster at cleaning up resources." Still, just in case, he decides to add a call to close into his code. It does seem to help some, but he is still able to reproduce the problem if he refreshes often enough. Feeling confused, he adds a log statement right before calling close to see if it is working: use sqlx::Connection; #[async_std::main]
async fn do_the_thing() -> Result<(), sqlx::Error> { // Create a connection let conn = SqliteConnection::connect("sqlite::memory:").await?; // Make a simple query to return the given parameter let row: (i64,) = sqlx::query_as("SELECT $1") .bind(150_i64) .fetch_one(&conn).await?; // <----- if this await is cancelled, doesn't help assert_eq!(row.0, 150); // he adds this: log!("closing the connection"); conn.close(); Ok(())
} He observes that in the cases where he has the problem the log statement never executes. He asks Barbara for help and she points him to this gist that explains how await can be canceled, and cancellation will invoke the destructors for things that are in scope. He reads the source for the SqliteConnection destructor and finds that destructor spawns a task to actually close the connection. He realizes there is a race condition and the task may not have actually closed the connection before do_the_thing is called a second time. At this point, he is feeling pretty frustrated! Next, Alan seeks verification and validation of his understanding of the source code from the sqlx forum. Someone on the forum explains why the destructor launches a fresh task: Rust doesn't have a way to execute async operations in a destructor.

199.body:
With Pin hopefully ignored, Alan next notices that in the imperative style he wanted originally, he didn't need to explicitly keep track of state. The state was simply the imperative order of the function. But in a poll function, the state isn't saved by the compiler. Alan finds blog posts about the dark ages of Futures 0.1, when it was more common for manual Futures to be written with a "state machine". He thinks about his stream's states, and settles on the following structure: struct SigningFile { state: State, file: ReaderStream, sig: Signature,
} enum State { File, Sign,
} It turns out it was more complicated than Alan thought (the author made this same mistake). The digest method of Signature is async, and it consumes the signature, so the state machine needs to be adjusted. The signature needs to be able to be moved out, and it needs to be able to store a future from an async fn. Trying to figure out how to represent that in the type system was difficult. He considered adding a generic T: Future to the State enum, but then wasn't sure what to set that generic to. Then, he tries just writing Signing(impl Future) as a state variant, but that triggers a compiler error that impl Trait isn't allowed outside of function return types. Patient Barbara helped again, so that Alan learns to just store a Pin<Box<dyn Future>>, wondering if the Pin there is important. struct SigningFile { state: State,
} enum State { File(ReaderStream, Signature), Signing(Pin<Box<dyn Future<Output = Vec<u8>>>>), Done,
} Now he tries to write the poll_next method, checking readiness of individual steps (thankfully, Alan remembers ready! from the futures 0.1 blog posts he read) and proceeding to the next state, while grumbling away the weird Pin noise: match self.state { State::File(ref mut file, ref mut sig) => { match ready!(Pin::new(file).poll_next(cx)) { Some(result) => { let chunk = result?; sig.push(&chunk); Poll::Ready(Some(Ok(chunk))) }, None => { let sig = match std::mem::replace(&mut self.state, State::Done) { State::File(_, sig) => sig, _ => unreachable!(), }; self.state = State::Signing(Box::pin(sig.digest())); Poll::Pending } } }, State::Signing(ref mut sig) => { let last_chunk = ready!(sig.as_mut().poll(cx)); self.state = State::Done; Poll::Ready(Some(Ok(last_chunk))) } State::Done => Poll::Ready(None),
} Oh well, at least it works , right?

200.body:
So far, Alan hasn't paid too much attention to Context and Poll. It's been fine to simply pass them along untouched. There's a confusing bug in his state machine. Let's look more closely: // zooming in!
match ready!(Pin::new(file).poll_next(cx)) { Some(result) => { let chunk = result?; sig.push(&chunk); return Poll::Ready(Some(Ok(val)); }, None => { self.set_state_to_signing(); // oops! return Poll::Pending; }
} In one of the branches, the state is changed, and Poll::Pending is returned. Alan assumes that the task will be polled again with the new state. But, since the file was done (and has returned Poll::Ready), there was actually no waker registered to wake the task again. So his stream just hangs forever. The compiler doesn't help at all, and he re-reads his code multiple times, but because of this easy-to-misunderstand logic error, Alan eventually has to ask for help in a chat room. After a half hour of explaining all sorts of details, a kind person points out he either needs to register a waker, or perhaps use a loop. All too often, since we don't want to duplicate code in multiple branches, the solution for Alan is to add an odd loop around the whole thing, so that the next match branch uses the Context: loop { match self.state { State::File(ref mut file, ref mut sig) => { match ready!(Pin::new(file).poll_next(cx)) { Some(result) => { let chunk = result?; sig.push(&chunk); return Poll::Ready(Some(Ok(chunk))) }, None => { let sig = match std::mem::replace(&mut self.state, State::Done) { State::File(_, sig) => sig, _ => unreachable!(), }; self.state = State::Signing(Box::pin(sig.digest())); // loop again, to catch the `State::Signing` branch } } }, State::Signing(ref mut sig) => { let last_chunk = ready!(sig.as_mut().poll(cx)); self.state = State::Done; return Poll::Ready(Some(Ok(last_chunk))) } State::Done => return Poll::Ready(None), }
}

217.body:
Alan heard about a project to reimplement a deprecated browser plugin using Rust and WASM. This old technology had the ability to load resources over HTTP; so it makes sense to try and implement that functionality using the Fetch API. Alan looks up the documentation of web_sys and realizes they need to... Call one of the fetch methods , which returns a Promise Convert the Promise into a Rust thing called a Future await the Future in an async function Do whatever they want with the resulting data use web_sys::{Request, window}; fn make_request(src: &url) -> Request { // Pretend this contains all of the complicated code necessary to // initialize a Fetch API request from Rust
} async fn load_image(src: String) { let request = make_request(&url); window().unwrap().fetch_with_request(&request).await; log::error!("It worked");
} Alan adds calls to load_image where appropriate. They realize that nothing is happening, so they look through more documentation and find a thing called spawn_local . Once they pass the result of load_image into that function, they see their log message pop up in the console, and figure it's time to actually do something to that loaded image data. At this point, Alan wants to put the downloaded image onto the screen, which in this project means putting it into a Node of the current World. A World is a bundle of global state that's passed around as things are loaded, rendered, and scripts are executed. It looks like this: /// All of the player's global state.
pub struct World<'a> { /// A list of all display Nodes. nodes: &'a mut Vec<Node>, /// The last known mouse position. mouse_pos &'a mut (u16, u16), // ...
} In synchronous code, this was perfectly fine. Alan figures it'll be fine in async code, too. So Alan adds the world as a function parameter and everything else needed to parse an image and add it to our list of nodes: async fn load_image(src: String, inside_of: usize, world: &mut World<'_>) { let request = make_request(&url); let data = window().unwrap().fetch_with_request(&request).await.unwrap().etc.etc.etc; let image = parse_png(data, context); let new_node_index = world.nodes.len(); if let Some(parent) = world.nodes.get(inside_of) { parent.set_child(new_node_index); } world.nodes.push(image.into());
} Bang! Suddenly, the project stops compiling, giving errors like... error[E0597]: `world` does not live long enough --> src/motionscript/globals/loader.rs:21:43 Hmm, okay, that's kind of odd. We can pass a World to a regular function just fine - why do we have a problem here? Alan glances over at loader.rs... fn attach_image_from_net(world: &mut World<'_>, args: &[Value]) -> Result<Value, Error> { let this = args.get(0).coerce_to_object()?; let url = args.get(1).coerce_to_string()?; spawn_local(load_image(url, this.as_node().ok_or("Not a node!")?, world))
} Hmm, the error is in that last line. spawn_local is a thing Alan had to put into everything that called load_image, otherwise his async code never actually did anything. But why is this a problem? Alan can borrow a World, or anything else for that matter, inside of async code; and it should get it's own lifetime like everything else, right? Alan has a hunch that this spawn_local thing might be causing a problem, so Alan reads the documentation. The function signature seems particularly suspicious: pub fn spawn_local<F>(future: F) where F: Future<Output = ()> + 'static So, spawn_local only works with futures that return nothing - so far, so good - and are 'static. Uh-oh. What does that last bit mean? Alan asks Barbara, who responds that it's the lifetime of the whole program. Yeah, but... the async function is part of the program, no? Why wouldn't it have the 'static lifetime? Does that mean all functions that borrow values aren't 'static, or just the async ones? Barbara explains that when you borrow a value in a closure, the closure doesn't gain the lifetime of that borrow. Instead, the borrow comes with it's own lifetime, separate from the closure's. The only time a closure can have a non-'static lifetime is if one or more of its borrows is not provided by it's caller, like so: fn benchmark_sort() -> usize { let mut num_times_called = 0; let test_values = vec![1,3,5,31,2,-13,10,16]; test_values.sort_by(|a, b| { a.cmp(b) num_times_called += 1; }); num_times_called
} The closure passed to sort_by has to copy or borrow anything not passed into it. In this case, that would be the num_times_called variable. Since we want to modify the variable, it has to be borrowed. Hence, the closure has the lifetime of that borrow, not the whole program, because it can't be called anytime - only when num_times_called is a valid thing to read or write. Async functions, it turns out, act like closures that don't take parameters ! They have to , because all Futures have to implement the same trait method poll: pub trait Future { type Output; fn poll(self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output>;
} When you call an async function, all of it's parameters are copied or borrowed into the Future that it returns. Since we need to borrow the World, the Future has the lifetime of &'a mut World, not of 'static. Barbara suggests changing all of the async function's parameters to be owned types. Alan asks Grace, who architected this project. Grace recommends holding a reference to the Plugin that owns the World, and then borrowing it whenever you need the World. That ultimately looks like the following: async fn load_image(src: String, inside_of: usize, player: Arc<Mutex<Player>>) { let request = make_request(&url); let data = window().unwrap().fetch_with_request(&request).await.unwrap().etc.etc.etc; let image = parse_png(data, context); player.lock().unwrap().update(|world| { let new_node_index = world.nodes.len(); if let Some(parent) = world.nodes.get(inside_of) { parent.set_child(new_node_index); } world.nodes.push(image.into()); });
} It works, well enough that Alan is able to finish his changes and PR them into the project. However, Alan wonders if this could be syntactically cleaner, somehow. Right now, async and update code have to be separated - if we need to do something with a World, then await something else, that requires jumping in and out of this update thing. It's a good thing that we only really have to be async in these loaders, but it's also a shame that we practically can't mix async code and Worlds.

221.body:
Alan is working on a project with Barbara which has already gotten off to a somewhat rocky start . He is working on abstracting away the HTTP implementation the library uses so that users can provide their own. He wants the user to implement an async trait called HttpClient which has one method perform(request: Request) -> Response. Alan tries to create the async trait: trait HttpClient { async fn perform(request: Request) -> Response;
} When Alan tries to compile this, he gets an error: --> src/lib.rs:2:5 |
2 | async fn perform(request: Request) -> Response; | -----^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ | | | `async` because of this | = note: `async` trait functions are not currently supported = note: consider using the `async-trait` crate: https://crates.io/crates/async-trait Alan, who has been using Rust for a little while now, has learned to follow compiler error messages and adds async-trait to his Cargo.toml. Alan follows the README of async-trait and comes up with the following code: #[async_trait]
trait HttpClient { async fn perform(request: Request) -> Response;
} Alan's code now compiles, but he also finds that his compile times have gone from under a second to around 6s, at least for a clean build. After Alan finishes adding the new trait, he shows his work off to Barbara and mentions he's happy with the work but is a little sad that compile times have worsened. Barbara, an experienced Rust developer, knows that using async-trait comes with some additional issues. In this particular case she is especially worried about tying their public API to a third-party dependency. Even though it is technically possible to implement traits annotated with async_trait without using async_trait, doing so in practice is very painful. For example async_trait: handles lifetimes for you if the returned future is tied to the lifetime of some inputs. boxes and pins the futures for you. which the implementer will have to manually handle if they don't use async_trait. She decides to not worry Alan with this right now. Alan and Barbara are pretty happy with the results and go on to publish their crate which gets lots of users. Later on, a potential user of the library wants to use their library in a no_std context where they will be providing a custom HTTP stack. Alan and Barbara have done a pretty good job of limiting the use of standard library features and think it might be possible to support this use case. However, they quickly run into a show stopper: async-trait boxes all of the futures returned from a async trait function. They report this to Alan through an issue. Alan, feeling (over-) confident in his Rust skills, decides to try to see if he can implement async traits without using async-trait. trait HttpClient { type Response: Future<Output = Response>; fn perform(request: Request) -> Self::Response; } Alan seems to have something working, but when he goes to update the examples of how to implement this trait in his crate's documentation, he realizes that he either needs to: use trait object: struct ClientImpl; impl HttpClient for ClientImpl { type Response = Pin<Box<dyn Future<Output = Response>>>; fn perform(request: Request) -> Self::Response { Box::pin(async move { // Some async work here creating Reponse }) }
} which wouldn't work for no_std. implement Future trait manually, which isn't particulary easy/straight-forward for non-trivial cases, especially if it involves making other async calls (likely). After a lot of thinking and discussion, Alan and Barbara accept that they won't be able to support no_std users of their library and add mention of this in crate documentation.

257.body:
Alan now starts with his first async project. He sees that there is no async in the standard library, but after googling for "rust async file open", he finds 'async_std', a crate that provides some async versions of the standard library functions. He has some code written that asynchronously interacts with some files: use async_std::fs::File;
use async_std::prelude::*; fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; Ok(())
} But now the compiler complains that await is only allowed in async functions. He now notices that all the examples use #[async_std::main] as an attribute on the main function in order to be able to turn it into an async main, so he does the same to get his code compiling: use async_std::fs::File;
use async_std::prelude::*; #[async_std::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; Ok(())
} This aligns with what he knows from C#, where you also change the entry point of the program to be async, in order to use await. Everything is great now, the compiler is happy, so no runtime problems, so Alan is happy. The project is working like a charm.

258.body:
The project Alan is building is starting to grow, and he decides to add a new feature that needs to make some API calls. He starts using reqwest in order to help him achieve this task. After a lot of refactoring to make the compiler accept the program again, Alan is satisfied that his refactoring is done. His program now boils down to: use async_std::fs::File;
use async_std::prelude::*; #[async_std::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; let body = reqwest::get("https://www.rust-lang.org") .await? .text() .await?; println!("{}", body); Ok(())
} He runs his project but is suddenly greeted with a runtime error. He is quite surprised. "How is this even possible?", he thinks. "I don't have any out-of-bounds accesses, and I never use .unwrap or .expect." At the top of the error message he sees: thread 'main' panicked at 'there is no reactor running, must be called from the context of a Tokio 1.x runtime' He searches what "Tokio" is in Rust, and he finds that it also provides an attribute to put on main, namely [tokio::main], but what is the difference with [async_std::main]? His curiosity leads him to watch videos/read blogs/scour reddit,... on why there are multiple runtimes in Rust. This leads him into a rabbit hole and now he learns about Executors, Wakers, Pin,... He has a basic grasp of what they are, but does not have a good understanding of them or how they all fit together exactly. These are all things he had not need to know nor heed in C#. (Note: there is another story about troubles/confusion that might arise when learning all these things about async: Alan hates writing a Stream ) He does understand the current problems and why there is no one-size-fits-all executor (yet). Trying to get his async Rust code to work, he broadened his knowledge about what async code actually is, he gains another way to reason about asynchronous code, not only in Rust, but also more generally. But now he realizes that there is a whole new area of runtime problems that he did not have to deal with in C#, but he does in Rust. Can he even trust the Rust compiler anymore? What other kinds of runtime problems can occur in Rust that can't in C#? If his projects keep increasing in complexity, will other new kinds of runtime problems keep popping up? Maybe it's better to stick with C#, since Alan already knows all the runtime problems you can have over there.

268.body:
One of Alan's first Rust related tasks in his job at YouBuy is writing an HTTP based service. This service is a simple internal proxy router that inspects an incoming HTTP request and picks the downstream service to call based on certain aspects of the HTTP request. Alan decides that he'll simply use some shared state that request handlers can read from in order to decide how to proxy the request. Alan, having read the Rust book and successfully completed the challenge in the last chapters , knows that shared state can be achieved in Rust with reference counting (using std::sync::Arc) and locks (using std::sync::Mutex). Alan starts by throwing his shared state (a std::collections::HashMap<String, url::Url>) into an Arc<Mutex<T>>. Alan, smitten with how quickly he can write Rust code, ends up with some code that compiles that looks roughly like this: #[derive(Clone)]
struct Proxy { routes: Arc<Mutex<HashMap<String, String>>,
} impl Proxy { async fn handle(&self, key: String, request: Request) -> crate::Result<Response> { let routes = self.state.lock().unwrap(); let route = routes.get(key).unwrap_or_else(crate::error::MissingRoute)?; Ok(self.client.perform_request(route, request).await?) }
} Alan is happy that his code seems to be compiling! The short but hard learning curve has been worth it. He's having fun now! Unfortunately, Alan's happiness soon comes to end as he starts integrating his request handler into calls to tokio::spawn which he knows will allow him to manage multiple requests at a time. The error message is somewhat cryptic, but Alan is confident he'll be able to figure it out: 189 | tokio::spawn(async { | ^^^^^^^^^^^^ future created by async block is not `Send`
::: /home/alan/.cargo/registry/src/github.com-1ecc6299db9ec823/tokio-1.5.0/src/task/spawn.rs:129:21 |
129 | T: Future + Send + 'static, | ---- required by this bound in `tokio::spawn` note: future is not `Send` as this value is used across an await --> src/handler.rs:787:9 |
786 | let routes = self.state.lock().unwrap(); | - has type `std::sync::MutexGuard<'_, HashMap<String, Url>>` which is not `Send`
787 | Ok(self.client.perform_request(route, request).await?) | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ await occurs here, with `routes` maybe used later
788 | }) | - `routes` is later dropped here Alan stops and takes a deep breath. He tries his best to make sense of the error message. He sort of understands the issue the compiler is telling him. Apparently routes is not marked as Send, and because it is still alive over a call to await, it is making the future his handler returns not Send. And tokio's spawn function seems to require that the future it received be Send. Alan reaches the boundaries of his knowledge of Rust, so he reaches out over chat to ask his co-worker Barbara for help. Not wanting to bother her, Alan provides the context he's already figured out for himself. Barbara knows that mutex guards are not Send because sending mutex guards to different threads is not a good idea. She suggests looking into async locks which can be held across await points because they are Send. Alan looks into the tokio documentation for more info and is easily able to move the use of the standard library's mutex to tokio's mutex. It compiles! Alan ships his code and it gets a lot of usage. After a while, Alan notices some potential performance issues. It seems his proxy handler does not have the throughput he would expect. Barbara, having newly joined his team, sits down with him to take a look at potential issues. Barbara is immediately worried by the fact that the lock is being held much longer than it needs to be. The lock only needs to be held while accessing the route and not during the entire duration of the downstream request. She suggests to Alan to switch to not holding the lock across the I/O operations. Alan first tries to do this by explicitly cloning the url and dropping the lock before the proxy request is made: impl Proxy { async fn handle(&self, key: String, request: Request) -> crate::Result<Response> { let routes = self.state.lock().unwrap(); let route = routes.get(key).unwrap_or_else(crate::error::MissingRoute)?.clone(); drop(routes); Ok(self.client.perform_request(route, request).await?) }
} This compiles fine and works in testing! After shipping to production, they notice a large increase in throughput. It seems their change made a big difference. Alan is really excited about Rust, and wants to write more! Alan continues his journey of learning even more about async Rust. After some enlightening talks at the latest RustConf, he decides to revisit the code that he and Barbara wrote together. He asks himself, is using an async lock the right thing to do? This lock should only be held for a very short amount of time. Yielding to the runtime is likely more expensive than just synchronously locking. But he remembers vaguely hearing that you should never use blocking code in async code as this will block the entire async executor from being able to make progress, so he doubts his intuition. After chatting with Barbara, who encourages him to benchmark and measure, he decides to switch back to synchronous locks. Unfortunately, switching back to synchronous locks brings back the old compiler error message about his future not being Send. Alan is confused as he's dropping the mutex guard before it ever crosses an await point. Confused Alan goes to Barbara for advice. She is also confused, and it takes several minutes of exploration before she comes to a solution that works: wrapping the mutex access in a block and implicitly dropping the mutex. impl Proxy { async fn handle(&self, key: String, request: Request) -> crate::Result<Response> { let route = { let routes = self.state.lock().unwrap(); routes.get(key).unwrap_or_else(crate::error::MissingRoute)?.clone() }; Ok(self.client.perform_request(route, request).await?) }
} Barbara mentions she's unsure why explicitly dropping the mutex guard did not work, but they're both happy that the code compiles. In fact it seems to have improved the performance of the service when its under extreme load. Alan's intuition was right! In the end, Barbara decides to write a blog post about how blocking in async code isn't always such a bad idea.

276.body:
Alan is working on a project that uses async-std. He has worked a bit with tokio in the past and is more familiar with that, but he is interested to learn something how things work in async-std. One of the goals is to switch from a WebSocket implementation using raw TCP sockets to one managed behind an HTTP server library, so both HTTP and WebSocket RPC calls can be forwarded to a transport-agnostic RPC server. In this server implementation: RPC call strings can be received over a WebSocket The strings are decoded and sent to an RPC router that calls the methods specified in the RPC call Some of the methods that are called can take some time to return a result, so they are spawned separately RPC has built-in properties to organize call IDs and methods, so results can be sent in any order Since WebSockets are bidirectional streams (duplex sockets), the response is sent back through the same client socket He finds the HTTP server tide and it seems fairly similar to warp, which he was using with tokio. He also finds the WebSocket middleware library tide-websockets that goes with it. However, as he's working, Alan encounters a situation where the socket needs to be written to within an async thread, and the traits just aren't working. He wants to split the stream into a sender and receiver: use futures::{SinkExt, StreamExt};
use async_std::sync::{Arc, Mutex};
use log::{debug, info, warn}; async fn rpc_ws_handler(ws_stream: WebSocketConnection) { let (ws_sender, mut ws_receiver) = ws_stream.split(); let ws_sender = Arc::new(Mutex::new(ws_sender)); while let Some(msg) = ws_receiver.next().await { debug!("Received new WS RPC message: {:?}", msg); let ws_sender = ws_sender.clone(); async_std::task::spawn(async move { let res = call_rpc(msg).await?; match ws_sender.lock().await.send_string(res).await { Ok(_) => info!("New WS data sent."), Err(_) => warn!("WS connection closed."), }; }); }
} The split method splits the ws_stream into two separate halves: a producer (ws_sender) that implements a Stream with the messages arriving on the websocket; a consumer (ws_receiver) that implements Sink, which can be used to send responses. This way, one task can pull items from the ws_sender and spawn out subtasks. Those subtasks share access to the ws_receiver and send messages there when they're done. Unfortunately, Alan finds that he can't use this pattern here, as the Sink trait wasn't implemented in the WebSockets middleware library he's using. Alan also tries creating a sort of poller worker thread using an intermediary messaging channel, but he has trouble reasoning about the code and wasn't able to get it to compile: use async_std::channel;
use async_std::sync::{Arc, Mutex};
use log::{debug, info, warn}; async fn rpc_ws_handler(ws_stream: WebSocketConnection) { let (ws_sender, mut ws_receiver) = channel::unbounded::<String>(); let ws_receiver = Arc::new(ws_receiver); let ws_stream = Arc::new(Mutex::new(ws_stream)); let poller_ws_stream = ws_stream.clone(); async_std::task::spawn(async move { while let Some(msg) = ws_receiver.next().await { match poller_ws_stream.lock().await.send_string(msg).await { Ok(msg) => info!("New WS data sent. {:?}", msg), Err(msg) => warn!("WS connection closed. {:?}", msg), }; } }); while let Some(msg) = ws_stream.lock().await.next().await { async_std::task::spawn(async move { let res = call_rpc(msg).await?; ws_sender.send(res); }); }
} Alan wonders if he's thinking about it wrong, but the solution isn't as obvious as his earlier Sink approach. Looking around, he realizes a solution to his problems already exists-- as others have been in his shoes before-- within two other nearly-identical pull requests, but they were both closed by the project maintainers. He tries opening a third one with the same code, pointing to an example where it was actually found to be useful. To his joy, his original approach works with the code in the closed pull requests in his local copy! Alan's branch is able to compile for the first time. However, almost immediately, his request is closed with a comment suggesting that he try to create an intermediate polling task instead , much as he was trying before. Alan is feeling frustrated. "I already tried that approach," he thinks, "and it doesn't work!" As a result of his frustration, Alan calls out one developer of the project on social media. He knows this developer is opposed to the Sink traits. Alan's message is not well-received: the maintainer sends a short response and Alan feels dismissed. Alan later finds out he was blocked. A co-maintainer responds to the thread, defending and supporting the other maintainer's actions, and suggests that Alan "get over it". Alan is given a link to a blog post. The post provides a number of criticisms of Sink but, after reading it, Alan isn't sure what he should do instead. Because of this heated exchange, Alan grows concerned for his own career, what these well-known community members might think or say about his to others, and his confidence in the community surrounding this language that he really enjoys using is somewhat shaken. Despite this, Alan takes a walk, gathers his determination, and commits to maintaining his fork with the changes from the other pull requests that were shut down. He publishes his version to crates.io, vowing to be more welcoming to "misfit" pull requests like the one he needed. A few weeks later, Alan's work at his project at work is merged with his new forked crate. It's a big deal, his first professional open source contribution to a Rust project! Still, he doesn't feel like he has a sense of closure with the community. Meanwhile, his friends say they want to try Rust, but they're worried about its async execution issues, and he doesn't know what else to say, other than to offer a sense of understanding. Maybe the situation will get better someday, he hopes.

292.body:
YouBuy is written using an async web framework that predates the stabilization of async function syntax. When Alan joins the company, it is using async functions for its business logic, but can't use them for request handlers because the framework doesn't support it yet. It requires the handler's return value to be Box<dyn Future<...>>. Because the web framework predates async function syntax, it requires you to take ownership of the request context (State) and return it alongside your response in the success/error cases. This means that even with async syntax, an http route handler in this web framework looks something like this (from the Gotham Diesel example ): // For reference, the framework defines these type aliases.
pub type HandlerResult = Result<(State, Response<Body>), (State, HandlerError)>;
pub type HandlerFuture = dyn Future<Output = HandlerResult> + Send; fn get_products_handler(state: State) -> Pin<Box<HandlerFuture>> { use crate::schema::products::dsl::*; async move { let repo = Repo::borrow_from(&state); let result = repo.run(move |conn| products.load::<Product>(&conn)).await; match result { Ok(prods) => { let body = serde_json::to_string(&prods).expect("Failed to serialize prods."); let res = create_response(&state, StatusCode::OK, mime::APPLICATION_JSON, body); Ok((state, res)) } Err(e) => Err((state, e.into())), } } .boxed()
} and then it is registered like this: router_builder.get("/").to(get_products_handler); The handler code is forced to drift to the right a lot, because of the async block, and the lack of ability to use ? forces the use of a match block, which drifts even further to the right. This goes against what he has learned from his days writing go . Rather than switching YouBuy to a different web framework, Alan decides to contribute to the web framework himself. After a bit of a slog and a bit of where-clause-soup, he manages to make the web framework capable of using an async fn as an http request handler. He does this by extending the router builder with a closure that boxes up the impl Future from the async fn and then passes that closure on to .to(). fn to_async<H, Fut>(self, handler: H) where Self: Sized, H: (FnOnce(State) -> Fut) + RefUnwindSafe + Copy + Send + Sync + 'static, Fut: Future<Output = HandlerResult> + Send + 'static, { self.to(move |s: State| handler(s).boxed()) } The handler registration then becomes: router_builder.get("/").to_async(get_products_handler); This allows him to strip out the async blocks in his handlers and use async fn instead. // Type the library again, in case you've forgotten:
pub type HandlerResult = Result<(State, Response<Body>), (State, HandlerError)>; async fn get_products_handler(state: State) -> HandlerResult { use crate::schema::products::dsl::*; let repo = Repo::borrow_from(&state); let result = repo.run(move |conn| products.load::<Product>(&conn)).await; match result { Ok(prods) => { let body = serde_json::to_string(&prods).expect("Failed to serialize prods."); let res = create_response(&state, StatusCode::OK, mime::APPLICATION_JSON, body); Ok((state, res)) } Err(e) => Err((state, e.into())), }
} It's still not fantastically ergonomic though. Because the handler takes ownership of State and returns it in tuples in the result, Alan can't use the ? operator inside his http request handlers. If he tries to use ? in a handler, like this: async fn get_products_handler(state: State) -> HandlerResult { use crate::schema::products::dsl::*; let repo = Repo::borrow_from(&state); let prods = repo .run(move |conn| products.load::<Product>(&conn)) .await?; let body = serde_json::to_string(&prods).expect("Failed to serialize prods."); let res = create_response(&state, StatusCode::OK, mime::APPLICATION_JSON, body); Ok((state, res))
} then he receives: error[E0277]: `?` couldn't convert the error to `(gotham::state::State, HandlerError)` --> examples/diesel/src/main.rs:84:15 |
84 | .await?; | ^ the trait `From<diesel::result::Error>` is not implemented for `(gotham::state::State, HandlerError)` | = note: the question mark operation (`?`) implicitly performs a conversion on the error value using the `From` trait = note: required by `std::convert::From::from` Alan knows that the answer is to make another wrapper function, so that the handler can take an &mut reference to State for the lifetime of the future, like this: async fn get_products_handler(state: &mut State) -> Result<Response<Body>, HandlerError> { use crate::schema::products::dsl::*; let repo = Repo::borrow_from(&state); let prods = repo .run(move |conn| products.load::<Product>(&conn)) .await?; let body = serde_json::to_string(&prods).expect("Failed to serialize prods."); let res = create_response(&state, StatusCode::OK, mime::APPLICATION_JSON, body); Ok(res)
} and then register it with: route.get("/").to_async_borrowing(get_products_handler); but Alan can't work out how to express the type signature for the .to_async_borrowing() helper function. He submits his .to_async() pull-request upstream as-is, but it nags on his mind that he has been defeated. Shortly afterwards, someone raises a bug about ?, and a few other web framework contributors try to get it to work, but they also get stuck. When Alan tries it, the compiler diagnostics keep sending him around in circles . He can work out how to express the lifetimes for a function that returns a Box<dyn Future + 'a> but not an impl Future because of how where clauses are expressed. Alan longs to be able to say "this function takes an async function as a callback" (fn register_handler(handler: impl async Fn(state: &mut State) -> Result<Response, Error>)) and have Rust elide the lifetimes for him, like how they are elided for async functions. A month later, one of the contributors finds a forum comment by Barbara explaining how to express what Alan is after (using higher-order lifetimes and a helper trait). They implement this and merge it. The final .to_async_borrowing() implementation ends up looking like this (also from Gotham ): pub trait AsyncHandlerFn<'a> { type Res: IntoResponse + 'static; type Fut: std::future::Future<Output = Result<Self::Res, HandlerError>> + Send + 'a; fn call(self, arg: &'a mut State) -> Self::Fut;
} impl<'a, Fut, R, F> AsyncHandlerFn<'a> for F
where F: FnOnce(&'a mut State) -> Fut, R: IntoResponse + 'static, Fut: std::future::Future<Output = Result<R, HandlerError>> + Send + 'a,
{ type Res = R; type Fut = Fut; fn call(self, state: &'a mut State) -> Fut { self(state) }
} pub trait HandlerMarker { fn call_and_wrap(self, state: State) -> Pin<Box<HandlerFuture>>;
} impl<F, R> HandlerMarker for F
where R: IntoResponse + 'static, for<'a> F: AsyncHandlerFn<'a, Res = R> + Send + 'static,
{ fn call_and_wrap(self, mut state: State) -> Pin<Box<HandlerFuture>> { async move { let fut = self.call(&mut state); let result = fut.await; match result { Ok(data) => { let response = data.into_response(&state); Ok((state, response)) } Err(err) => Err((state, err)), } } .boxed() }
} ... fn to_async_borrowing<F>(self, handler: F) where Self: Sized, F: HandlerMarker + Copy + Send + Sync + RefUnwindSafe + 'static, { self.to(move |state: State| handler.call_and_wrap(state)) } Alan is still not sure whether it can be simplified. Later on, other developers on the project attempt to extend this approach to work with closures, but they encounter limitations in rustc that seem to make it not work ( rust-lang/rust#70263 ). When Alan sees another open source project struggling with the same issue, he notices that Barbara has helped them out as well. Alan wonders how many people in the community would be able to write .to_async_borrowing() without help.

